import './App.css';
import React, { useEffect, useState } from 'react';
import NameForm from './component/NameForm';
import DisplayPanel from './component/DisplayPanel';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  const [data, setData] = useState([])
  const [active, setActive] = useState('False')

  const fetchdata= async (object) =>{

    console.log('values from FORM', object);
    await fetch(`http://172.16.0.107:9000/api/assets/temp?categoryId=${object.category}&bundleId=${object.bundle}`)
        .then((response) => response.json())
        .then((actualData) => {
          setData(actualData.data);
        })
        .catch((err) => {
         console.log(err.message);
        });
  }

  useEffect(()=>{
    // fetchdata();
  },[])

  return (
    <div className="App">
      <NameForm/>
      <hr/>
      <DisplayPanel data={data} fetchdata={fetchdata} active={active} setActive={setActive}/>
    </div>
  );
}

export default App;
